    top: 50%;
    right: 12px;
    margin-top: -12px;
  }
}

sources.style\\main.scss:
$main-font: #333;
$main-green: #669900;
$main-white: #f6f5f0;
$main-grey: #999;

$sub-grey: #656565;
$sub-green: #64a70b;

$bright-grey: #e5e5e5;
$darker-grey: #2c2a29;

$real-black: #000;
$real-white: #fff;

$footer-grey: #272727;

@mixin backgroundSet() {
  background: {
    repeat: no-repeat;
    position: center;
    attachment: fixed;
    size: cover;
  }
}

// COMMON
body {
  color: $main-font;
  font-size: 16px;
  font-weight: 400;
  line-height: 1.4;
  font-family: "Nanum Gothic", sans-serif;

  img {
    display: block;
  }
  a {
    text-decoration: none;
  }
  .inner {
    position: relative;
    width: 1100px;
    margin: 0 auto;
  }
}

.btn {
  $btn-grey: #333;
  $btn-brown: #592b18;
  $btn-gold: #d9aa8a;
  $btn-white: #fff;

  width: 130px;
  padding: 10px;
  border: 2px solid $btn-grey;
  border-radius: 4px;
  color: $btn-grey;
  font-size: 1em;
  font-weight: 700;
  text-align: center;
  cursor: pointer;
  box-sizing: border-box;
  display: block;
  transition: 0.4s;
  &:hover {
    background-color: $btn-grey;
    color: $btn-white;
  }

  // reverse
  &.btn--reverse {
    background-color: $btn-grey;
    color: $btn-white;
    &:hover {
      background-color: transparent;
      color: $btn-grey;
    }
  }

  // brown
  &.btn--brown {
    color: $btn-brown;
    border-color: $btn-brown;
    &:hover {
      color: $btn-white;
      background-color: $btn-brown;
    }
  }

  // gold
  &.btn--gold {
    color: $btn-gold;
    background-color: transparent;
    border: 1px solid $btn-gold;
    &:hover {
      color: $btn-white;
      background-color: $btn-gold;
    }
  }

  // white
  &.btn--white {
    color: $btn-white;
    border-color: $btn-white;
    &:hover {
      color: $btn-grey;
      background-color: $btn-white;
    }
  }
}

.back-to-position {
  opacity: 0;
  transition: 1s;
  &.to-right {
    transform: translateX((-150px));
  }
  &.to-left {
    transform: translateX((150px));
  }
}

.show {
  .back-to-position {
    opacity: 1;
    transform: translateX(0);
    @for $i from 0 through 3 {
      &.delay-#{$i} {
        transition-delay: #{$i * 0.3}s;
      }
    }
  }
}

// HEADER
header {
  position: fixed;
  background-color: $main-white;
  border-bottom: 1px solid #c8c8c8;
  top: 0;
  width: 100%;
  z-index: 100;

  > .inner {
    width: 100%;
    height: 120px;

    // logo
    .logo {
      height: 75px;
      position: absolute;
      top: 0;
      bottom: 0;
      margin: auto;
    }

    // sub-menu
    .sub-menu {
      position: absolute;
      top: 10px;
      right: 0;
      display: flex;
      .menu {
        font-family: Arial, Helvetica, sans-serif;
        display: flex;
        li {
          position: relative;
          a {
            font-size: 0.75em;
            padding: 11px 16px;
            display: block;
            color: $sub-grey;
            &:hover {
              color: $real-black;
            }
          }
          &:first-child::before {
            display: none;
          }
          &::before {
            position: absolute;
            content: "";
            width: 1px;
            height: 0.75em;
            background-color: $bright-grey;
            top: 0;
            bottom: 0;
            margin: auto;
          }
        }
      }
      .search {
        position: relative;
        height: 34px;
        input {
          width: 36px;
          height: 34px;
          padding: 4px 10px;
          border: 1px solid #ccc;
          box-sizing: border-box;
          border-radius: 5px;
          outline: none;
          background-color: $real-white;
          color: $sub-grey;
          font-size: 0.75em;
          transition: width 0.4s;
          &:focus {
            width: 190px;
            border-color: $main-green;
          }
        }
        .material-icons {
          height: 24px;
          position: absolute;
          top: 0;
          bottom: 0;
          right: 5px;
          margin: auto;
          transition: 0.4s;
        }
        &.focused {
          .material-icons {
            opacity: 0;
          }
        }
      }
    }

    // main-menu
    .main-menu {
      display: flex;
      position: absolute;
      bottom: 0;
      right: 0;
      z-index: 1;
      .item {
        .item__name {
          padding: 10px 20px 34px 20px;
          font: {
            family: Arial, sans-serif;
            size: 13px;
          }
          &:hover {
            cursor: pointer;
            background-color: $darker-grey;
            color: $main-green;
            border-radius: 6px 6px 0 0;
          }
        }
        .item__contents {
          width: 100%;
          position: fixed;
          left: 0;
          display: none;
          .contents__menu {
            background-color: $darker-grey;
            > ul {
              display: flex;
              padding: 20px 0;
              > li {
                width: 220px;
                h4 {
                  padding: 3px 0 12px 0;
                  font-size: 14px;
                  color: $real-white;
                }
                ul {
                  li {
                    padding: 5px 0;
                    font-size: 0.75em;
                    color: $main-grey;
                    cursor: pointer;
                    &:hover {
                      color: $main-green;
                    }
                  }
                }
              }
            }
          }
          .contents__texture {
            background-image: url("../images/main_menu_pattern.jpg");
            padding: 26px 0;
            font-size: 0.75em;
            h4 {
              color: $main-grey;
              font-weight: 700;
            }
            p {
              color: $main-green;
              margin: 4px 0 14px;
            }
          }
        }
        &:hover {
          .item__contents {
            display: block;
          }
        }
      }
    }

    // responsive-menu
    .responsive-menu,
    .toggle-menu-wrap {
      display: none;
    }
  }

  // badge
  .badges {
    position: absolute;
    top: 132px;
    right: 12px;
    .badge {
      border-radius: 10px;
      overflow: hidden;
      margin-bottom: 12px;
      box-shadow: 4px 4px 10px rgba($color: $real-black, $alpha: 0.15);
      cursor: pointer;
    }
  }
}

// VISUAL
.visual {
  margin-top: 120px;
  background-image: url("../images/visual_bg.jpg");
  background-position: center;
  .inner {
    height: 646px;
    // title
    .title {
      position: absolute;
      top: 88px;
      left: -10px;
      .btn {
        position: absolute;
        top: 259px;
        left: 173px;
      }
    }

    // image
    .cup1 {
      &.image {
        position: absolute;
        bottom: 0;
        right: -47px;
      }
      &.text {
        position: absolute;
        top: 38px;
        right: 171px;
      }
    }
    .cup2 {
      &.image {
        position: absolute;
        bottom: 0;
        right: 162px;
      }
      &.text {
        position: absolute;
        top: 321px;
        right: 416px;
      }
    }
    .spoon {
      position: absolute;
      bottom: 0px;
      right: 275px;
    }
  }

  // fade in
  .fade-in {
    opacity: 0;
  }
}

// NOTICE
.notice {
  // notice
  .notice-line {
    position: relative;
    .bg-left {
      position: absolute;
      top: 0;
      left: 0;
      width: 50%;
      height: 100%;
      background-color: $main-font;
    }
    .bg-right {
      position: absolute;
      top: 0;
      right: 0;
      width: 50%;
      height: 100%;
      background-color: $main-white;
    }
    .inner {
      height: 62px;
      display: flex;

      .inner__left {
        width: 60%;
        height: 100%;
        background-color: $main-font;
        display: flex;
        align-items: center;
        h2 {
          color: $real-white;
          font-size: 1.1em;
          font-weight: 700;
          margin-right: 20px;
        }
        .swiper-container {
          flex-grow: 1;
          height: 62px;
          .swiper-slide {
            height: 62px;
            display: flex;
            align-items: center;
            a {
              color: $real-white;
            }
          }
        }
        .notice-line__more {
          display: flex;
          width: 62px;
          height: 62px;
          justify-content: center;
          align-items: center;
          .material-icons {
            color: $real-white;
            font-size: 1.875em;
          }
        }
      }

      .inner__right {
        width: 40%;
        height: 100%;
        display: flex;
        justify-content: flex-end;
        align-items: center;
        h2 {
          font-size: 1.1em;
          font-weight: 700;
        }
        .toggle-promotion {
          width: 62px;
          height: 62px;
          cursor: pointer;
          display: flex;
          align-items: center;
          justify-content: center;
          .material-icons {
            font-size: 1.875em;
          }
        }
      }
    }
  }

  // promotion
  .promotion {
    position: relative;
    height: 693px;
    background-color: $main-white;
    transition: height 0.4s;
    overflow: hidden;
    &.hide {
      height: 0;
    }

    .swiper-container {
      width: calc(819px * 3 + 20px);
      height: 553px;
      position: absolute;
      top: 40px;
      left: 50%;
      margin-left: calc((819px * 3 + 20px) / -2);
    }

    .swiper-slide {
      position: relative;
      opacity: 0.5;
      transition: opacity 1s;

      .btn {
        position: absolute;
        bottom: 0;
        left: 0;
        right: 0;
        margin: auto;
      }
    }
    .swiper-slide-active {
      opacity: 1;
    }

    .swiper-pagination {
      bottom: 40px;
      left: 0;
      right: 0;
      .swiper-pagination-bullet {
        background-color: transparent;
        background-image: url("../images/promotion_slide_pager.png");
        width: 12px;
        height: 12px;
        margin-right: 6px;
        outline: none;
        &:last-child {
          margin-right: 0px;
        }
        &.swiper-pagination-bullet-active {
          background-image: url("../images/promotion_slide_pager_on.png");
        }
      }
    }
    .swiper-prev,
    .swiper-next {
      width: 42px;
      height: 42px;
      border: 2px solid $main-font;
      border-radius: 50%;
      position: absolute;
      top: 300px;
      z-index: 10;
      cursor: pointer;
      outline: none;
      display: flex;
      justify-content: center;
      align-items: center;
      transition: 0.4s;
      &:hover {
        background-color: $main-font;
        color: $real-white;
      }
    }
    .swiper-prev {
      left: 50%;
      margin-left: -480px;
    }
    .swiper-next {
      right: 50%;
      margin-right: -480px;
    }
  }
}

// REWARDS
.rewards {
  $left-color: #272727;
  $right-color: #d5c798;

  position: relative;

  .inner {
    background-image: url("../images/rewards.jpg");
    height: 241px;

    .btn-group {
      position: absolute;
      bottom: 24px;
      right: 0;
      width: 250px;
      display: flex;
      flex-wrap: wrap;
      .btn {
        &.sign-up {
          margin-right: 10px;
        }
        &.sign-in {
          width: 110px;
        }
        &.gift {
          margin-top: 10px;
          flex-grow: 1;
        }
      }
    }
  }

  .bg-left {
    width: 50%;
    height: 100%;
    background-color: $left-color;
    position: absolute;
    top: 0;
    left: 0;
  }
  .bg-right {
    width: 50%;
    height: 100%;
    background-color: $right-color;
    position: absolute;
    top: 0;
    right: 0;
  }
}

// YOUTUbe
.youtube {
  position: relative;
  height: 700px;
  background-color: $main-font;
  overflow: hidden;

  // video
  .youtube__area {
    position: absolute;
    width: 1920px;
    background-color: orange;
    left: 50%;
    margin-left: calc(1920px / -2);
    top: 50%;
    margin-top: calc(1920px * 9 / 16 / -2);

    &::before {
      content: "";
      display: block;
      width: 100%;
      height: 0;
      padding-top: 56.25%;
    }
  }
  .youtube__cover {
    background-image: url("../images/video_cover_pattern.png");
    background-color: rgba($color: $real-black, $alpha: 0.3);
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
  }

  #player {
    width: 100%;
    height: 100%;
    position: absolute;
    top: 0;
    left: 0;
  }

  // icons
  .inner {
    height: 700px;

    .floating {
      &.floating1 {
        position: absolute;
        top: 50px;
        left: 0;
      }
      &.floating2 {
        position: absolute;
        top: 350px;
        left: 150px;
      }
    }
  }
}

// SEASON PRODUCT
.season-product {
  background-image: url("../images//season_product_bg.jpg");
  .inner {
    height: 400px;
    .floating3 {
      position: absolute;
      top: -200px;
      right: 0;
    }
    .text-group {
      position: absolute;
      top: 120px;
      right: 100px;
      .title {
        margin-bottom: 10px;
      }
      .description {
        margin-bottom: 15px;
      }
    }
  }
}

// RESERVE COFFEE
.reserve-coffee {
  background-image: url("../images/reserve_bg.jpg");
  .inner {
    height: 400px;
    .reserve-logo {
      position: absolute;
      top: 110px;
      left: 0;
    }

    .text-group {
      position: absolute;
      top: 124px;
      left: 208px;
    }

    .product {
      position: absolute;
      top: 0;
      right: 0;
    }
  }
}

// PICK YOUR FAVORITE
.pick-your-favorite {
  background-image: url("../images/favorite_bg.jpg");
  @include backgroundSet();
  .inner {
    padding: 110px 0;
    .text-group {
      margin-left: 100px;
      display: flex;
      width: 362px;
      flex-wrap: wrap;
      justify-content: flex-end;
      .title {
        margin-bottom: 40px;
      }
      .description {
        margin-bottom: 40px;
      }
    }
  }
}

// RESERVE STORE
.reserve-store {
  background-image: url("../images/reserve_store_bg.jpg");
  @include backgroundSet();
  .inner {
    height: 600px;
    display: flex;
    justify-content: center;
    align-items: center;

    .medal {
      width: 334px;
      height: 334px;
      perspective: 600px;
      .front,
      .back {
        width: 334px;
        height: 334px;
        backface-visibility: hidden;
        transition: 1s;
        position: absolute;
      }
      .front {
        transform: rotateY(0deg);
      }
      .back {
        transform: rotateY(-180deg);
        .btn {
          position: absolute;
          top: 240px;
          right: 0;
          left: 0;
          margin: auto;
        }
      }
      &:hover {
        .front {
          transform: rotateY(180deg);
        }
        .back {
          transform: rotateY(0deg);
        }
      }
    }
  }
}

// FIND THE STORE
.find-the-store {
  background-image: url("../images/find_store_bg.jpg");
  .inner {
    height: 400px;

    // texture
    .texture1 {
      position: absolute;
      top: 0;
      left: 400px;
    }
    .texture2 {
      position: absolute;
      bottom: 0;
      right: 0;
    }

    // picture
    .picture {
      border-radius: 50%;
      box-shadow: 2px 2px 8px rgba($color: $real-black, $alpha: 0.5);
      position: absolute;
    }
    .picture1 {
      top: -60px;
      left: 0;
    }
    .picture2 {
      top: 150px;
      left: 250px;
    }

    // text
    .text-group {
      position: absolute;
      top: 120px;
      left: 550px;
      .title {
        margin-bottom: 20px;
      }
      .description {
        margin-bottom: 20px;
      }
    }
  }
}

// AWARDS
.awards {
  background-color: $footer-grey;
  .inner {
    padding: 40px 0;
    .swiper-container {
      width: 100%;
      height: 40px;
    }
  }

  .swiper-prev,
  .swiper-next {
    width: 42px;
    height: 42px;
    border: 2px solid $real-white;
    border-radius: 50%;
    outline: none;
    color: $real-white;
    opacity: 0.3;
    cursor: pointer;
    display: flex;
    justify-content: center;
    align-items: center;
    position: absolute;
    top: 0;
    bottom: 0;
    margin: auto;
    &:hover {
      background-color: $real-white;
      color: $main-font;
    }
  }
  .swiper-prev {
    left: -100px;
  }
  .swiper-next {
    right: -100px;
  }
}

// FOOTER
footer {
  $menu-grey: #ccc;
  $list-grey: #555;
  background-color: $footer-grey;
  border-top: 1px solid $main-font;
  .inner {
    padding: 40px 0 60px 0;
    // menu
    .menu {
      display: flex;
      justify-content: center;
      li {
        position: relative;
        a {
          color: $menu-grey;
          font-size: 12px;
          font-weight: 700;
          padding: 15px;
          display: block;
          &.green {
            color: $main-green;
          }
        }
        &::before {
          content: "";
          width: 3px;
          height: 3px;
          background-color: $list-grey;
          position: absolute;
          top: 0;
          bottom: 0;
          right: -1px;
          margin: auto;
        }
        &:last-child::before {
          display: none;
        }
      }
    }

    // btn
    .btn-group {
      margin-top: 20px;
      display: flex;
      justify-content: center;
      .btn {
        font-size: 12px;
        margin-right: 10px;
        &:last-child {
          margin-right: 0;
        }
      }
    }

    // info
    .info {
      margin-top: 30px;
      text-align: center;
      span {
        margin-right: 20px;
        color: $main-grey;
        font-size: 12px;
        &:last-child {
          margin-right: 0;
        }
      }
    }

    // copyright
    .copyright {
      color: $main-grey;
      font-size: 12px;
      margin-top: 12px;
      text-align: center;
      .logo {
        margin: 30px auto 0;
      }
    }
  }
}

// TOP
#to-top {
  display: none;
  width: 42px;
  height: 42px;
  background-color: $main-font;
  color: $real-white;
  border: 2px solid $real-white;
  border-radius: 10px;
  cursor: pointer;
  // display: flex;
  justify-content: center;
  align-items: center;
  position: fixed;
  bottom: 30px;
  right: 30px;
  z-index: 10;
}

@media screen and (max-width: 1130px) {
  header {
    .inner {
      height: 70px;
      .main-menu,
      .sub-menu {
        display: none;
      }

      .logo {
        height: 45px;
        img {
          width: 45px;
          height: 45px;
        }
      }

      // MENU ICON
      .responsive-menu {
        display: flex;
        position: absolute;
        color: $sub-grey;
        right: 0;
        top: 16px;
        a {
          padding-right: 16px;
          justify-content: center;
          align-items: center;
          color: $sub-grey;
          font-size: 35px;
          &:last-child {
            padding-right: 0;
          }
        }
      }

      .toggle-shadow {
        display: none;
        position: fixed;
        width: 100%;
        height: 100%;
        z-index: 100;
        background-color: black;
        opacity: 70%;
      }

      // TOGGLE MENU
      .toggle-menu-wrap {
        display: none;
        $aside-clor: #2d2926;
        height: 100%;
        overflow: auto;
        width: 0%;
        height: 100%;
        z-index: 100;
        background-color: $aside-clor;
        position: fixed;
        display: flex;
        flex-direction: column;
        right: 0;
        color: $real-white;

        .close {
          position: absolute;
          cursor: pointer;
          left: 8px;
          top: 4px;
        }

        .search {
          display: flex;
          justify-content: center;
          margin: 36px 0 24px 0;
          input {
            float: left;
            height: 24px;
            width: 60%;
            margin-right: 8px;
          }
          button {
            float: right;
            background-color: #666;
            color: $real-white;
            border: none;
            border-radius: 4px;
            width: 20%;
            cursor: pointer;
          }
        }
        ul {
          .menu-title {
            position: relative;
            background-color: #111;
            font-weight: 900;
            font-size: 1.5em;
            border-bottom: 1px solid #222;
            padding: 8px;
            padding-left: 16px;
            &.sub {
              background-color: #181818;
            }
            &:hover {
              text-decoration: underline;
              cursor: pointer;
            }
          }
          .subtitle-items {
            background-color: #222;
            font-weight: 400;
            font-size: 1em;
            color: #999;

            li {
              padding: 4px;
              padding-left: 36px;
              &:hover {
                text-decoration: underline;
                cursor: pointer;
              }
            }
          }
          .material-icons {
            position: absolute;
            top: 50%;
            right: 12px;
